//     e.target.reset();
    
// }
  return (
    
    <div className="containers">
          <Helmet>
                <style>{'body { background-color: #f2f3f5,counter-reset: section}',
                'h2::before {counter-increment: section;content: "Section " counter(section)": "}'}</style>
          </Helmet>

          <div class="container">
          <div class="row">
          <div style={{marginTop:"4%"}}>
          <p style={{textAlign:"center",fontSize:"30px",fontFamily:"poppins"}}>GET IN TOUCH WITH US</p>
          <div class="text-center"style={{marginBottom:"-2%"}}><button id="button-20">CONTACT US</button></div>
          <div style={{
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      fontSize: '300%',
      position: 'absolute',
      width: '100%',
      height: '100%',
      top: '-15%',
    }}>
      Counter App
      <div style={{
        fontSize: '120%',
        position: 'relative',
        top: '10vh',
      }}>
        {counter}
      </div>
      <div className="buttons">
        <button style={{
          fontSize: '60%',
          position: 'relative',
          top: '20vh',
          marginRight: '5px',
          backgroundColor: 'green',
          borderRadius: '8%',
          color: 'white',
        }}
          onClick={handleClick1}>Increment</button>
        <button style={{
          fontSize: '60%',
          position: 'relative',
          top: '20vh',
          marginLeft: '5px',
          backgroundColor: 'red',
          borderRadius: '8%',
          color: 'white',
        }}
          onClick={handleClick2}>Decrement</button>
      </div>
    </div>
 
        </div>
        </div>
        </div>
    
    <br/>
</div>

  );
  
}
